data.description:
Liste des établissements et services pour personnes âgées situés en Île-de-France (source FINESS /15-05-2013) et géolocalisation :

  * établissements d'Hébergement pour Personnes Âgées (hospices, maisons de retraites, logement, accueil temporaire) ;
  * services sanitaires de maintien à domicile (centres de jour) ;
  * services sociaux (foyers clubs restaurants,aide ménagère à domicile, alarme médico-sociale, repas à domicile, services d'aides) ;
  * établissements expérimentaux en faveur des personnes âgées
